  const list = props.list;

  return (<div>
  {list.map((element: [string, Items]): ReactElement => {
    const [type, items] = element;
    const itemsName = items.map((item:Items): ReactElement<[]>=> {
      const name = item.name;
      // return <div key={name}>{name}</div>
      return <FoodTemp key={name} name={name}/>
    });
    return (
      <div key={type}>
      <div>{type}</div>
      <div>{itemsName}</div>
      </div>
      );})}
  </div>)
}
